'use strict';
let SendSingleCommandWithoutResponse = require('./SendSingleCommandWithoutResponse.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
//@@DocBrief("The command for getting system properties")
class GetSystemPropertiesCommand extends SendSingleCommandWithoutResponse {
    constructor() {
        super();
        this.commandName = "GetSystemPropertiesCommand";
    }
    createTransportMessage() {
        return this.messageFactory.createGetSystemPropertiesRequestMessage(this.tradingSession, this.requestNumberGenerator, stdlib.nowutc());
    }
}
module.exports = GetSystemPropertiesCommand
